By the way, I am an Irishman, and we love your country for donating money to us when we were suffering a famine in 1845; 

In fact, one of our national league football clubs (Drogheda) badge has a crescent and star, and this resembles the Ottoman Empire as they had sent 3 ships filled with food to the port of Drogheda, to help our people.

